    constructor(props) {
        super();
        this.state = {
        };
    }
    render() {
        return (
            <div>
                <Container>
                    <Row>
                        <Col>
                            <h3>IMMERSING THE VIEWER IN THE EXPERIENCE THROUGH A VISUAL MEDIUM.</h3>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={{ span: 6, offset: 2 }}>
                            <ReactPlayer light={true} url="https://www.youtube.com/watch?v=loi-EW2dfyE" />
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default HomePage;
